    true,nt"url": null,nt"notes": "<p>Medicare Beneficiary Knowledge of the
    Part D Program and Its Relationship with Voluntary Enrollment<br />nAccording to
    findings appearing in Medicare Beneficiary Knowledge of the Part D Program and Its
    Relationship with Voluntary Enrollment, published in Volume 2, Issue 4 of the Medicare
    and Medicaid Research Review, during the initial open enrollment period, although
    overall knowledge about the Part D program was limited, beneficiaries who knew correct
    facts about the program, like everyone has plan choices and assistance is available
    for low income beneficiaries, were more likely to enroll in a plan. Efforts to educate
    Medicare beneficiaries about the Part D program may improve rates of prescription
    drug coverage.</p>n",nt"license_title": "Other License Specified",nt"extras":
